import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  headDataContainer: {
    maxWidth: "80%",
  },
  headDataItem: {
    fontSize: theme.typography.h4.fontSize,
    textAlign: "center",
  },
  logo: {
    width: "40px",
  },
}));
